export default function TrafficLastLocations({ data, toggleModal}) {  
    let plate = data['evento_infevento_nrplaca']
    let location = data['evento_infevento_dsreflocal']


    const openMapModal = () => {

      let modalData = {
        plate: plate,
        location : location

      }
      toggleModal(modalData)
    }

    return (
      <>
        <div
          className={location !== "null" && "underlined_text"}
          onClick={() => {  openMapModal() }}
          style={{ cursor: location !== "null" && "pointer", color: '#2322c8' }}
        >
          {location}
        </div>
      </>
    )
  }
